const Foot = styled.footer`
  height: 80vh;
  width: 100%;
  background-color: var(--bg-blue);
`

const FooterContent = styled.div`
  width: inherit;
  display: grid;
  justify-items: start;
  justify-content: start;
  align-items: start;
  margin: 0 auto;
  grid-template-columns: repeat(3, minmax(10px, 1fr));
  grid-template-rows: min-content minmax(10px, 1fr) auto;
  max-width: 1080px;
  flex-grow: 1;
`

const FooterBottomContent = styled.div`
  width: 100%;
  display: flex;
  align-items: center;
  justify-content: space-between;
  border-top: 1px solid var(--text-red);
  flex-flow: row wrap;
  margin-top: 2em;
  padding-top: 1em;
  grid-column-start: 1;
  grid-column-end: 4;
  grid-row-start: 3;
  grid-row-end: 4;
`

const ServicesContainer = styled.div`
  grid-column-start: 2;
  grid-column-end: 3;
  grid-row-start: 2;
  grid-row-end: 3;
  display: flex;
  flex-direction: column;
`

const InsightsContainer = styled.div`
  grid-column-start: 3;
  grid-column-end: 4;
  grid-row-start: 2;
  grid-row-end: 3;
  flex-direction: column;
  display: flex;
`

const CompanyLogoContainer = styled.div`
  padding: 2rem 0;
  width: min-content;
  max-height: min-content;
`

const CompanyInfoContainer = styled.div`
  grid-column-start: 1;
  grid-column-end: 2;
  grid-row-start: 2;
  grid-row-end: 3;

  flex-direction: column;
`

const Heading = styled.h3`
  padding: 0.6em 0;

  font-size: 1em;
  color: var(--text-dark);
`

const Paragraph = styled.p`
  line-height: 1.8em;
  padding: 0.3em 0;
  color: var(--text-gray);
`

const FooterLinks = styled.p`
  line-height: 1.8em;
  padding: 0.3em 0;
  color: var(--text-gray);

  transition: all 0.3s ease;
  :hover {
    color: #dd2476;
  }
`

const SmallText = styled.small`
  padding-left: 1em;
  color: var(--text-gray);
`
const StyledIcon = styled(FontAwesomeIcon)`
  color: var(--text-gray);
  margin-right: 0.6em;
  font-size: 1.8em;
  transition: all 0.3s ease;
  :hover {
    color: #dd2476;
  }
`

